var statusData = "off";

function formatNumber(number) {
	number = parseFloat(number)
	number = number.toFixed(2)
	number += ''
	return (number)
}

function fetchOrders() {
	GM_xmlhttpRequest({
		method: 'GET',
		url: 'https://docs.google.com/document/pub?id=1qSD7ygfljfOt0o-tpzbtzt-6R7MT_olO4N0kl-JIBIA',
		onload:function(response) {
			//Retrieve and truncate string
			var order_string = response.responseText.replace(/\r\n/g, "").replace(/\n/g, "");
			order_string = order_string.match(/<span.*?<\/span>/m)[0];
			order_string = order_string.replace(/<.*?>/gi, '');
			order_string = order_string.replace(/&lt;/g, '<').replace(/&gt;/g, '>').replace(/&#0*39;/g, "'").replace(/&quot;/g, '"').replace(/&amp;/g, '&');
			order_string = eval('(' + order_string + ')');
			
			var date = order_string[0];
			var time = order_string[1];
			var region = order_string[2];
			var battle_link = order_string[3];
			var news = order_string[4];
			var news_link = order_string[5];
			
			if (statusData == "off") {
				var sjebContent = '<table><tr><td><span class="sjeb_orders_noauth">You are not authorised to use this script!</span></td></tr></table>';
			} else {
				var sjebContent = '<a href="' + battle_link + '" target="_blank"><table><tr><td align="left" style="padding-top: 3px;"><span class="sjeb_orders_date">' + date + '</span></td></tr><tr><td><span class="sjeb_orders_time">' + time + '</span></td></tr><tr><td><span class="sjeb_orders_region">' + region + '</span></td></tr></table></a>';
			}
			
			$('#logo').after('<div class="sjeb_orders_holder"><div class="sjeb_links_holder"><div class="sjeb_link_elem_holder"><div class="sjeb_link_element"><a href="http://economy.erepublik.com/en/accounts/2641761" target="_blank">SJeB 1</a></div></div><div class="sjeb_link_elem_holder"><div class="sjeb_link_element"><a href="http://economy.erepublik.com/en/accounts/2815108" target="_blank">SJeB 2</a></div></div><div class="sjeb_link_elem_holder"><div class="sjeb_link_element"><a href="http://economy.erepublik.com/en/accounts/2873004" target="_blank">SJeB 3</a></div></div><div class="sjeb_link_elem_holder"><div class="sjeb_link_element"><a href="http://economy.erepublik.com/en/accounts/3272227" target="_blank">SJeB 4</a></div></div><div class="sjeb_link_elem_holder"><div class="sjeb_link_element"><a href="http://economy.erepublik.com/en/accounts/3392032" target="_blank">SJeB 5</a></div></div><div class="sjeb_link_elem_holder"><div class="sjeb_link_element"><a href="http://economy.erepublik.com/en/accounts/3392071" target="_blank">SJeB 6</a></div></div><div class="sjeb_link_elem_holder"><div class="sjeb_link_element"><a href="http://economy.erepublik.com/en/accounts/2634124" target="_blank">Prijatelji</a></div></div></div><div class="sjeb_orders_main">' + sjebContent + '</div></div>');
			if (statusData == "off") {
				$('.sjeb_orders_main').css('background', 'none');
			}
		}
	});
}

function Main() {
	GM_xmlhttpRequest({
		method: 'GET',
		url: 'http://sjeb.freehostia.com/usersdata',
		onload:function(response) {
			
			var userIds = response.responseText;
			userIds = userIds.split('|');
			userIds = eval(userIds);
			
			for (var c=0; c < userIds.length; c++) {
				if (mApprovedMain == userIds[c]) {
					statusData = "on";
				}
			}
			
			fetchOrders();
		}
	});
}

window.addEventListener('load', function() {var checker = setInterval(function() {
	if(typeof ($ = jQuery.noConflict()) != 'undefined') {
		clearInterval(checker);
		
		Main();
		
	}
},100);}, false);